    'content' => '<p>3 апреля 2017 года N 56-ФЗ</p>
<div>
<p>Статья 1<br />Внести в часть вторую Налогового кодекса Российской Федерации следующие изменения:<br />1) в статье 169:<br />а) пункт 5 дополнить подпунктом 6.2 следующего содержания:<br />6.2) идентификатор государственного контракта, договора (соглашения) (при наличии);<br />б) пункт 5.1 дополнить подпунктом 4.2 следующего содержания:<br />4.2) идентификатор государственного контракта, договора (соглашения) (при наличии);<br />в) пункт 5.2 дополнить подпунктом 6.1 следующего содержания:<br />6.1) идентификатор государственного контракта, договора (соглашения) (при наличии);<br />2) пункт 1 статьи 251 дополнить подпунктом 3.5 следующего содержания:<br />3.5) в виде имущества (за исключением субсидий), полученного в порядке, установленном Правительством Российской Федерации, управляющей компанией, которая является акционерным обществом, 100 процентов акций которого принадлежит Российской Федерации, и деятельность которой предусмотрена Федеральным законом от 29 декабря 2014 года N 473-ФЗ "О территориях опережающего социально-экономического развития в Российской Федерации";</p>
<p>Статья 2<br />1. Настоящий Федеральный закон вступает в силу со дня его официального опубликования, за исключением пункта 1 статьи 1 настоящего Федерального закона.<br />2. Пункт 1 статьи 1 настоящего Федерального закона вступает в силу по истечении одного месяца со дня официального опубликования настоящего Федерального закона и не ранее 1-го числа очередного налогового периода по налогу на добавленную стоимость.<br />3. Действие положений подпункта 3.5 пункта 1 статьи 251 Налогового кодекса Российской Федерации (в редакции настоящего Федерального закона) распространяется на правоотношения, возникшие с 31 марта 2015 года.</p>
</div>',
